create schema "import";

create table "import"."variable" (
    "abbrev" varchar(128),
    "label" varchar,
    "name" varchar,
    "description" varchar,
    "data_type" varchar,
    "not_null" varchar,
    "type" varchar,
    "status" varchar(32),
    "display_name" varchar,
    "ontology_reference" varchar,
    "bibliographical_reference" varchar,
    "property" varchar,
    "method" varchar,
    "scale" varchar,
    "scale_unit" varchar,
    "scale_type" varchar,
    "scale_level" varchar,
    "default_value" varchar,
    "minimum_value" varchar,
    "maximum_value" varchar,
    "variable_set" varchar,
    "synonym" varchar,
    "entry_message" varchar,
    "coded_values" varchar,
    "id" serial not null,
    "remarks" text,
    "creation_timestamp" timestamp not null default now(),
    "creator_id" integer not null default '1',
    "modification_timestamp" timestamp,
    "modifier_id" integer,
    "notes" text,
    "is_void" boolean not null default false
) with (
    oids = false
);

alter table "import"."variable"
  add constraint "variable_id_pkey"
  primary key ("id");
