alter table "import"."variable"
  add constraint "variable_modifier_id_fkey"
  foreign key ("modifier_id") references "master"."user" ("id")
  match simple on update cascade on delete cascade;

create index "variable_is_void_idx"
  on "import"."variable"
  using btree ("is_void");



